public Resource getResource() {
  if (resource != null) {
    return resource;
  }
  GetResourceProfileResponseProtoOrBuilder p = viaProto ? proto : builder;
  if (p.hasResources()) {
    resource = Resource.newInstance(p.getResources().getMemory(),
        p.getResources().getVirtualCores());
  }
  return resource;
}
